import React, { useState } from 'react';
import { Radio, Space, Form } from 'antd';

export default function Relatorio({item}){

    return(
        <Form.item 
        label={item.questao} 
        name={item.numero}
        rules={item.regra}
        >
            <Radio.Group>
                <Space direction="vertical">
                    {item.opcoes.map((opcao=>{
                        <Radio value={opcao}>{opcao}</Radio>
                    }))}
                </Space>
            </Radio.Group>
        </Form.item>
    );
}
